import React from 'react'
import wall from '../../static/wall.jpg'
import coffee from '../../static/coffee.jpg'
import unreal from '../../static/unreal.jpg'
import cover from '../../static/cover.jpg'
import photo from '../../static/photo.jpg'

export const Album = () => {
  const images = [wall, coffee, unreal, photo, cover]

  const handleClick = () => {

  }

  return(
    <div className="masonry_wrapper section">
      <div className="card z-depth-0 white">
        <section
          className="masonry"
          onClick={handleClick}>
          {images.map((image, index) => {
            return (

                <img
                  key={index}
                  src={image}
                  alt="img"
                  className=""/>

            )
          })}
        </section>
      </div>
    </div>
  )
}
